import React from 'react'
import firebase from 'firebase'
import Item from './Item'
import axios from 'axios'

class OwnerList extends React.Component {
    constructor(props) {
        super(props)
    }

    render() {
        let items = JSON.parse(axios.get(`https://us-central1-forku-dc443.cloudfunctions.net/item/get?username=${firebase.auth().currentUser.email}`))
        let i = 0
        let itemsList = items.map(item => {
            <li key={i}>
                <Item name={item.name} quantity={item.quantity} category={item.category}></Item>
            </li>
        })
        return (
            <ul> {itemsList} </ul>
        )
    }
}

export default OwnerList
